    function _getRandomNum(uint256 numAvailableRemainingTokens)
        internal
        view
        returns (uint256)
    {
        return
            uint256(
                keccak256(
                    abi.encode(
                        block.prevrandao,
                        blockhash(block.number - 1),
                        address(this),
                        numAvailableRemainingTokens
