                : "";
    }

    string private _baseTokenURI;
    string private _baseTokenURIPermanent;
    // Keys are Elemental token ids
    BitMaps.BitMap private _isUriPermanentForToken;

    function _getBaseURIForToken(uint256 tokenId)
